"""
There are some spherical balloons spread in two-dimensional space. For each balloon, provided input is the start and end
 coordinates of the horizontal diameter. Since it's horizontal, y-coordinates don't matter, and hence the x-coordinates
 of start and end of the diameter suffice. The start is always smaller than the end.

An arrow can be shot up exactly vertically from different points along the x-axis. A balloon with x_start and x_end
 bursts by an arrow shot at x if x_start ≤ x ≤ x_end. There is no limit to the number of arrows that can be shot. An
 arrow once shot keeps traveling up infinitely.

Given an array points where points[i] = [x_start, x_end], return the minimum number of arrows that must be shot to burst
 all balloons.
"""
from typing import List, Tuple


def min_arrow_shots(points: List[Tuple[int, int]]) -> int:
    """
    :param points: list of (x_start, x_end)
    :return:
    """
    if not points:
        return 0

    # sort by x_start
    points.sort()
    arrow_count = 1
    arrow_shoot_at = points[0][1]

    for x_start, x_end in points[1:]:
        if x_start <= arrow_shoot_at:
            arrow_shoot_at = min(arrow_shoot_at, x_end)
        else:
            arrow_count += 1
            arrow_shoot_at = x_end

    return arrow_count


